import { screenSizes, colors } from '../../constants'

const styles = {
  navbar: {
    position: 'fixed',
    height: '4rem',
    width: '100%',
    backgroundColor: colors[1].slateGrey,
    zIndex: 1001,
    paddingLeft: '1rem',
    paddingRight: '1rem'
    // marginLeft: 'auto',
    // marginRight: 'auto'
  },
  navbarContent: {
    position: 'relative',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    height: '100%'
  }
}

export default styles
